import './SignupFormStyles.css';

function SignupForm() {
    return (
        <div className='form-cnt'>
            <h1>Sign Up</h1>
            <form>
                <input type="email" placeholder='Email' />
                <input type="password" placeholder='Password' />
                <button>Sign Up</button>
                <p></p>
            </form>
        </div>
    )
}
export default SignupForm;
